package graphicMathEditor.formula;

import java.beans.PropertyChangeEvent;
import java.util.ArrayList;
import java.util.List;
import graphicMathEditor.atomManager.AtomManager;
import graphicMathEditor.atomManager.AtomManagerInterface;
import util.annotations.EditablePropertyNames;
import util.annotations.PropertyNames;
import util.annotations.StructurePattern;
import util.annotations.StructurePatternNames;


@StructurePattern(StructurePatternNames.BEAN_PATTERN)
@PropertyNames({"atoms"})
@EditablePropertyNames({})
public class Formula implements FormulaInterface{
	
	private List<AtomManagerInterface> atoms;
	private int x, y;
	private double scale;
	public static final int MARGIN = 5;
	
	
	public Formula(int newX, int newY, int newScale) {
		setX(newX);
		setY(newY);
		setScale(newScale);
		atoms = new ArrayList<AtomManagerInterface> ();
		insert(0);
	}

	@Override
	public List<AtomManagerInterface> getAtoms() {
		return atoms;
	}

	@Override
	public void propertyChange(PropertyChangeEvent evt) {
		if ("width".equals(evt.getPropertyName())) {
			reposition(atoms.indexOf(((AtomManager) evt.getSource())));
		}
		if ("string".equals(evt.getPropertyName())) {
			if (" ".equals((String) evt.getOldValue()) & (!" ".equals((String) evt.getNewValue()))) {
				System.err.println("String changed");
				int changedAtom = atoms.indexOf(((AtomManager) evt.getSource()));
				insert(changedAtom);
				insert(changedAtom + 2);
			}
		}
	}

	@Override
	public void insert(int position) {
		int atomX = 0;
		for (int i = 0; i < position; i ++) {
			atomX += getAtoms().get(i).getWidth() + MARGIN;
		}
		int atomY = y;
		getAtoms().add(position, new AtomManager(atomX, atomY, getScale()));
		getAtoms().get(position).addPropertyChangeListener(this);
		reposition(position);	
	}

	@Override
	public int getX() {
		return x;
	}

	@Override
	public void setX(int newX) {
		x = newX;
	}

	@Override
	public int getY() {
		return y;
	}

	@Override
	public void setY(int newY) {
		y = newY;
	}
	
	@Override
	public double getScale() {
		return scale;
	}

	@Override
	public void setScale(double newScale) {
		scale = newScale;
	}

	@Override
	public void reposition(int startPosition) {
		for (int i = startPosition + 1; i < atoms.size(); i ++){
			getAtoms().get(i).setX(getAtoms().get(i - 1).getX() + getAtoms().get(i - 1).getWidth() + MARGIN);
		}
	}

	@Override
	public void delete(AtomManagerInterface anAtom) {
		if (! " ".equals(anAtom.getString())) {
			int removeAtom = atoms.indexOf(anAtom);
			if (atoms.remove(anAtom)) {
				atoms.remove(removeAtom);
			}
			reposition(removeAtom);
		}
	}
	
	
}

